import React from "react";
import ReactEcharts from 'echarts-for-react';
import "./Right.css";


class Rop2 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
	
	getROption2 = () => {
		let op = {
			 yAxis: [{
                type: 'category',
                inverse: true,
                min: -8,
                axisLine: {
                    show: false
                },
                axisTick: {
                    show: false
                },
                axisLabel: {
                    interval: 0,
                    inside: true,
                    textStyle: {
                        color: "rgb(28,244,249)",
                        fontSize: 12,
                    },
                    show: true
                },
            }],
            xAxis: [{
                show: false
            }],
            series: [
			{
				name: '直接访问',
				type: 'pie',
				stack: '总量',
				barWidth: '60%',
				radius: ['20%', '20%'],
				itemStyle: {
					normal: {
						barBorderRadius: 5,
						color: '#00CCFF'
					}
				},
				data: [120, 200, 150, 80 , 100, 60]
			}],
		}
		return op;		
	}
   
    render() {
        return (
            <div>
                <ReactEcharts option={this.getROption2()} style={{height:'200px',width:'260px'}}></ReactEcharts>   
            </div>
        )
    }
}

export default Rop2;
